import React from 'react';

function App() {
  return (
      <div class="grid-container">
      <header class="row">
        <div>
          <a class="brand" href="index.html">
          Amazona
          </a>
        </div>
        <div>
          <a href="cart.html">Cart</a>
          <a href="signin.html">Sign In</a>
        </div>
      </header>



    <footer class="row center">All right reserved   </footer>
  </div>
  );
}

export default App;
